import React, { useEffect, useState } from 'react';

export const FicheEnchere = () => {

    const [items, setItems] = useState([]);


  useEffect(() => {
    fetch("http://192.168.43.146:8080/Produit/"+localStorage.getItem('id'),{ 
      method: "GET"
     })
     .then((response)=>response.json())
     .then((json)=>setItems(json.data));
  },[]);

  return (
    <>
    <h2>Fiche Enchere</h2>
    <table border="1">
        <thead>
          <tr>
            <th>Produit</th>
            <th>Categorie</th>
            <th>Client</th>
            <th>Email</th>
            <th>Prix</th>
            <th>Date enchere</th>
          </tr>
        </thead>
        <tbody>
        {items.map((item) => {
            return (
              <>
                <td>{item.nomproduit}</td>
                <td>{item.nomcategorie}</td>
                <td>{}</td>
                <td>{item.prixmin}</td>
                <td>{item.dateenchere}</td>
              </>
            )
        })}
        </tbody>
        </table>
    </>
  );
}

export default FicheEnchere;
